import React from 'react';
import logo from '../../assets/logo.svg';
import './styles.css';

const CreatePoint: React.FC = () => {
  return (
    <div id='page-create-point'>
      <header>
        <img src={logo} alti='Ecoleta' />
      </header>
    </div>
  );
};

export default CreatePoint;
